import React from "react";
import Container from 'react-bootstrap/Container'
import './Login.css'

const Login = () => {
  return (
    <div className = "login_bg">
      <Container>
        <div className = "login_form">
          <div className = "box1">
          Bach Khoa 
          </div>
        </div>
      </Container>
    </div>
  );
};

export default Login;
